  <style>
    body {
      margin: 0;
      background: #fff;
      font-family: 'Courier New', Courier, monospace;
      display: flex;
      flex-direction: column;
      align-items: center;
      padding: 20px;
      color: #111;
    }

    .pixel-container {
      margin-top: 30px;
      display: flex;
      justify-content: center;
      flex-wrap: wrap;
    }

    .pixel {
      width: 8px;
      height: 8px;
      float: left;
    }

    .clear {
      clear: both;
    }

    .profile {
      text-align: center;
      max-width: 100%;
    }

    .profile img {
      width: 120px;
      height: 120px;
      border-radius: 50%;
      object-fit: cover;
      margin-bottom: 15px;
      box-shadow: 0 4px 8px rgba(0,0,0,0.2);
    }

    h1 {
      font-size: 26px;
      margin: 0;
    }

    .tagline {
      font-size: 16px;
      font-weight: 500;
      color: #555;
      margin: 8px 0 20px;
    }

    .social-links {
      display: flex;
      flex-wrap: wrap;
      justify-content: center;
      gap: 10px;
      margin-top: 10px;
    }

    .social-links a {
      text-decoration: none;
      background: #000;
      color: #fff;
      padding: 8px 14px;
      border-radius: 6px;
      font-size: 14px;
      transition: background 0.3s;
      display: flex;
      align-items: center;
      gap: 6px;
    }

    .social-links a:hover {
      background: #444;
    }

    .social-links a svg {
      width: 16px;
      height: 16px;
    }

    @media (max-width: 600px) {
      .pixel {
        width: 5px;
        height: 5px;
      }
      .profile img {
        width: 90px;
        height: 90px;
      }
    }
